import React, {useState} from 'react';

function AddReview  () {

    const [reviewData, setReviewData] = useState({
        // dishName: '',
        // restaurant: '',
        // address: '',
        // cuisineGenre: '',
        // companions: '',
        dishSizeRating: 0,
        dishRanking: 1,
    });

    function handleReviewInputChange(event){
        const {name, value} = event.target;
        setReviewData({...reviewData,
        [name]: value})
        console.log(reviewData)

    }

    const handleSubmit = (event) => {
        event.preventDefault()
    }

    return(
        <div>
            <h2>Write a Review</h2>
            <form onSubmit={handleSubmit}>
                <label>Restaurant: 
                    <input
                    type='text'
                    name='restaurant_name'
                    value={reviewData.restaurant_name}
                    onChange={handleReviewInputChange}
                    />
                </label>
                <label>
                    Name of Dish:
                    <input
                    type="text"
                    name="dishName"
                    value={reviewData.dishName}
                    onChange={handleReviewInputChange}
                    />
                </label>
            <br></br>
                <label>
                    Genre of Cuisine:
                    <input
                    type="text"
                    name="cuisineGenre"
                    value={reviewData.cuisineGenre}
                    onChange={handleReviewInputChange}
                    />
                </label>
            <br></br>
                <label>
                    Reason for visit:
                    <input
                    type="text"
                    name="companions"
                    value={reviewData.companions}
                    onChange={handleReviewInputChange}
                    />
                </label>
            <br></br>
                <label>
                    Size of Dish (0-3 scale);
                    <input
                    type="number"
                    name="dishSizeRating"
                    value={reviewData.dishSizeRating}
                    onChange={handleReviewInputChange}
                    />
                </label>
            <br></br>
                <label>
                    Rank the Dish (1-9 scale):
                    <input
                    type="number"
                    name="dishRanking"
                    value={reviewData.dishRanking}
                    onChange={handleReviewInputChange}
                    />
                </label>
            <br></br>
                <button type="submit">Submit Review</button>
            </form>
        </div>
    )
}

export default AddReview
